import logo from "./images/netflix-Logo.svg";
import "./header.css";

function Header() {
  return (
    <>
      <nav>
        <div>
          <img className="nav_logo" src={logo} alt="Netflix Logo" />
        </div>
        <button>Sign In</button>
      </nav>
    </>
  );
}

export default Header;
